"use strict";var userList=new Vue({el:"#userList",data:function(){return{}},methods:{userDel:function(t){var e=this,n=this,s=t.target.parentNode.parentNode,i=s.firstChild.value;this.$confirm("确定删除该用户？","提示",{confirmButtonText:"确定",cancelButtonText:"取消",type:"warning"}).then(function(){axios.post("/user/del",{id:i}).then(function(t){"删除成功"==t.data?(s.style.display="none",n.$message("删除成功")):n.$message("删除错误")}).catch(function(t){console.log(t)})}).catch(function(){e.$message("删除取消")})}}});